(DYNE/CM)":0.628},{"Temperature (\u00b0F)":260.0,"Pressure (PSIA)":1489.71,"Density of Liquid (LB/FT\u00b3)":21.6,"Density of Vapor (LB/FT\u00b3)":8.1001,"Volume of Vapor (FT\u00b3/LB)":0.1233,"Enthalpy of Liquid (BTU/LB)":395.943,"Enthalpy of Vapor (BTU/LB)":547.139,"Entropy of Liquid (BTU/lb\u00b7\u00b0F)":0.67662,"Entropy of Vapor (BTU/lb\u00b7\u00b0F)":0.88671,"Specific Heat of Liquid Cp (BTU/lb\u00b7\u00b0F)":5.273,"Specific Heat of Vapor Cp (BTU/lb\u00b7\u00b0F)":8.106,"CP/CV of Vapor":9.439,"Velocity of Sound Liquid (FT/S)":1271.0,"Velocity of Sound Vapor (FT/S)":1045.9,"Viscosity of Liquid (lbm/(ft\u00b7h))":0.102,"Viscosity of Vapor (lbm/(ft\u00b7h))":0.0446,"Thermal Conductivity of Liquid (BTU/(hr\u00b7ft\u00b7F))":0.125,"Thermal Conductivity of Vapor (BTU/(hr\u00b7ft\u00b7F))":0.06473,"Surface Tension (DYNE/CM)":0.55}];
  const COLUMNS = ["Temperature (\u00b0F)","Pressure (PSIA)","Density of Liquid (LB/FT\u00b3)","Density of Vapor (LB/FT\u00b3)","Volume of Vapor (FT\u00b3/LB)","Enthalpy of Liquid (BTU/LB)","Enthalpy of Vapor (BTU/LB)","Entropy of Liquid (BTU/lb\u00b7\u00b0F)","Entropy of Vapor (BTU/lb\u00b7\u00b0F)","Specific Heat of Liquid Cp (BTU/lb\u00b7\u00b0F)","Specific Heat of Vapor Cp (BTU/lb\u00b7\u00b0F)","CP/CV of Vapor","Velocity of Sound Liquid (FT/S)","Velocity of Sound Vapor (FT/S)","Viscosity of Liquid (lbm/(ft\u00b7h))","Viscosity of Vapor (lbm/(ft\u00b7h))","Thermal Conductivity of Liquid (BTU/(hr\u00b7ft\u00b7F))","Thermal Conductivity of Vapor (BTU/(hr\u00b7ft\u00b7F))","Surface Tension (DYNE/CM)"];

  // Build UI
  const theadRow = document.getElementById("thead-row");
  const tbody = document.getElementById("tbody");
  const search = document.getElementById("search");
  const tmin = document.getElementById("tmin");
  const tmax = document.getElementById("tmax");
  const count = document.getElementById("count");
  const pillCols = document.getElementById("pill-cols");
  pillCols.textContent = COLUMNS.length + " columns";

  // Create header cells
  let sortState = []; // array of {key, dir}
  COLUMNS.forEach((col) => {
    const th = document.createElement("th");
    th.textContent = col;
    th.title = "Click to sort by this column";
    th.addEventListener("click", (e) => onHeaderClick(e, col));
    theadRow.appendChild(th);
  });

  function onHeaderClick(e, col) {
    const isShift = e.shiftKey;
    const existing = sortState.find((s) => s.key === col);
    if (!isShift) sortState = [];
    if (existing) {
      existing.dir = existing.dir === "asc" ? "desc" : "asc";
    } else {
      sortState.push({ key: col, dir: "asc" });
    }
    render();
  }

  function cmp(a, b) {
    if (a === b) return 0;
    // Try numeric compare if both parse
    const na = parseFloat(a);
    const nb = parseFloat(b);
    const aNum = !Number.isNaN(na) && String(a).trim() !== "";
    const bNum = !Number.isNaN(nb) && String(b).trim() !== "";
    if (aNum && bNum) return na < nb ? -1 : na > nb ? 1 : 0;
    // Fallback to string
    const sa = String(a);
    const sb = String(b);
    return sa.localeCompare(sb, undefined, { numeric: true });
  }

  function applySort(rows) {
    if (sortState.length === 0) return rows;
    const arr = [...rows];
    arr.sort((ra, rb) => {
      for (const {key, dir} of sortState) {
        const diff = cmp(ra[key], rb[key]);
        if (diff !== 0) return dir === "asc" ? diff : -diff;
      }
      return 0;
    });
    return arr;
  }

  function withinTempRange(rec) {
    const t = parseFloat(rec["Temperature (°F)"]);
    const minOk = !tmin.value || (!Number.isNaN(t) && t >= parseFloat(tmin.value));
    const maxOk = !tmax.value || (!Number.isNaN(t) && t <= parseFloat(tmax.value));
    return minOk && maxOk;
  }

  function matchesSearch(rec) {
    const q = search.value.trim().toLowerCase();
    if (!q) return true;
    for (const k of COLUMNS) {
      const v = rec[k];
      if (v != null && String(v).toLowerCase().includes(q)) return true;
    }
    return false;
  }

  function render() {
    const filtered = DATA.filter((r) => withinTempRange(r) && matchesSearch(r));
    const sorted = applySort(filtered);
    tbody.innerHTML = "";
    const frag = document.createDocumentFragment();
    for (const row of sorted) {
      const tr = document.createElement("tr");
      for (const col of COLUMNS) {
        const td = document.createElement("td");
        const val = row[col];
        td.textContent = val === null || val === undefined ? "" : val;
        tr.appendChild(td);
      }
      frag.appendChild(tr);
    }
    tbody.appendChild(frag);
    count.textContent = sorted.length + " rows shown (of " + DATA.length + ")";
  }

  // Initial render
  render();

  // Wire inputs
  for (const el of [search, tmin, tmax]) {
    el.addEventListener("input", render);
  }
</script>
